//create a react component that inputs a textarea message then performs a fetch request to localhost:3080 gets back a response as a data.message and displays that message in a box below
import React, { useState, useEffect } from 'react';  
import './App.css';

function App() {

  useEffect(() => {
    getEngines();
  }, [])

  const[input,setInput] = useState("");
  const[models,setModels] = useState([]);
  const[currentModel,setCurrentModel] = useState("text-davinci-003");
  const[chatLog,setChatLog] = useState([]);

  function clearChat(){
    setChatLog([]);
  }

  function getEngines(){
    fetch("http://localhost:30000/models")
    .then(res=>res.json())
    .then(data=>{
      setModels(data.models)
    })
  }

  async function handleSubmit(e){
    e.preventDefault();
    let chatLogNew = [...chatLog, {user: "me", message: `${input}`}]
    setInput("");
    setChatLog([...chatLogNew]);

    const messages = chatLogNew.map((message)=>message.message).join("\n");

    const response = await fetch('http://localhost:30000/', {
        method: 'POST', 
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          message: messages,
          currentModel,
        }),
      });
      const data = await response.json();
      setChatLog([...chatLogNew,{user: "gpt", message: `${data.message}`}]);
      console.log(data.message);
  }
  return (
    <div className="App">
      <aside className="sideMenu">
        <div className="side-menu-button" onClick={clearChat}>
          <span>+</span>
          New Chat
        </div>
        <div className="models">
        <select onChange={e =>{
          setCurrentModel(e.target.value)
        }}>
            {models.map((model,index) => (
              <option key={model.id} value={model.id}>
                  {model.id}
              </option>
            ))}
          </select>
        </div>
      </aside>
      <section className="chatBox">
        <div className="chat-log">
          {chatLog.map((message,index)=>(
            <ChatMessage key={index} message = {message}/>))}
        </div>
        <div className="chat-input-holder">
          <form onSubmit={handleSubmit}>
            <input
              rows="1"
              value={input}
              onChange={(e) => setInput(e.target.value)}
              className="chat-input-textarea"
              placeholder="Type in your questions here"
            />
          </form>
          <h6>Welcome to Pacific American School</h6>
        </div>
      </section>
    </div>
  );
}  
